import React, {useEffect, useState} from "react";
import BookService from "../Service/service";

export default function ListBook(){
  const[data, setData] = useState([]);

  const getValue = async ()=>{
    await BookService.showBook()
      .then((res) =>{
        // console.log(res.data)
        setData(res.data)
      })
      .catch((err)=>{
        console.log(err)
      })
  }

  useEffect(()=>{
    getValue()
  },[])

  return(
    <>
      <div className="card gedf-card">
        <div className="card-header">
          <ul className="nav nav-tabs card-header-tabs" id="myTab" role="tablist">
            <li className="nav-item">
              <a className="nav-link active" id="posts-tab" data-toggle="tab" href="#posts" role="tab"
                 aria-controls="posts" aria-selected="true">Make
                a publication</a>
            </li>
            {/*<li className="nav-item">*/}
            {/*  <a className="nav-link" id="images-tab" data-toggle="tab" role="tab" aria-controls="images"*/}
            {/*     aria-selected="false" href="#images">Images</a>*/}
            {/*</li>*/}
          </ul>
        </div>
        <div className="card-body">
          <div className="tab-content" id="myTabContent">
            <div className="tab-pane fade show active" id="posts" role="tabpanel" aria-labelledby="posts-tab">
              <div className="form-group">
                <label className="sr-only" htmlFor="message">post</label>
                <textarea className="form-control" id="message" rows="3"
                          placeholder="What are you thinking?"></textarea>
              </div>
            </div>
            {/*<div className="tab-pane fade" id="images" role="tabpanel" aria-labelledby="images-tab">*/}
            {/*  <div className="form-group">*/}
            {/*    <div className="custom-file">*/}
            {/*      <input type="file" className="custom-file-input" id="customFile" />*/}
            {/*        <label className="custom-file-label" htmlFor="customFile">Upload image</label>*/}
            {/*    </div>*/}
            {/*  </div>*/}
            {/*  <div className="py-4"></div>*/}
            {/*</div>*/}
          </div>

          <div className="btn-toolbar justify-content-between">
            <div className="btn-group">
              <button type="submit" className="btn btn-primary">share</button>
            </div>
            <div className="btn-group">
              <button id="btnGroupDrop1" type="button" className="btn btn-link dropdown-toggle" data-toggle="dropdown"
                      aria-haspopup="true"
                      aria-expanded="false">
                <i className="fa fa-globe"></i>
              </button>
            </div>
          </div>
        </div>
      </div>

      {
        data.map((item) =>(
          <div className="card gedf-card">
            <div className="card-header">
              <div className="d-flex justify-content-between align-items-center">
                <div className="d-flex justify-content-between align-items-center">
                  <div className="mr-2">
                    <img className="rounded-circle" width="45" src="https://picsum.photos/50/50" alt="" />
                  </div>
                  <div className="ml-2">
                    {/*<div className="h5 m-0">@LeeCross</div>*/}
                    <div className="h7 m-0">Trending this week in one of your favorite genres, Business</div>
                  </div>
                </div>
                <div>
                  <div className="dropdown">
                    <button className="btn btn-link dropdown-toggle" type="button" id="gedf-drop1"
                            data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                      <i className="fa fa-ellipsis-h"></i>
                    </button>
                    <div className="dropdown-menu dropdown-menu-right" aria-labelledby="gedf-drop1">
                      <div className="h6 dropdown-header">Configuration</div>
                      <a className="dropdown-item" href="/">Save</a>
                      <a className="dropdown-item" href="/">Hide</a>
                      <a className="dropdown-item" href="/">Report</a>
                    </div>
                  </div>
                </div>
              </div>

            </div>
            <div className="card-body">
              <div className="text-muted h7 mb-2"><i className="fa fa-clock-o"></i> 10 min ago</div>
              <a className="card-link" href={`/detailBook/${item._id}`}>
                <h5 className="card-title">{item.bookTitle}.</h5>
              </a>

              <p className="card-text">
                {item.description}.
              </p>
              <div>
                <span className="badge badge-primary">{item.author}</span>
              </div>
            </div>
            {/*<div className="card-footer">*/}
            {/*  <a href="/" className="card-link"><i className="fa fa-gittip"></i> Like</a>*/}
            {/*  <a href="/" className="card-link"><i className="fa fa-comment"></i> Comment</a>*/}
            {/*  <a href="/" className="card-link"><i className="fa fa-mail-forward"></i> Share</a>*/}
            {/*</div>*/}
          </div>
        ))
      }
    </>
  )
}
